import { Navbar } from "../Navbar/Navbar";
import "./sidebar.scss";
import navi from "../../assets/navi.png";
export const Sidebar = () => {
  return (
    <div className="sidebar">
      <div>
        <img src={navi} alt="phtoo" />
      </div>
      <Navbar />
    </div>
  );
};
